import React from 'react';
import { useTheme } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from './Title';

export default function Landing() {
  const theme = useTheme();

  return (

    <div>
		 <Typography component="h1" variant="h2" color="inherit" paddingBottom="10px" noWrap>
            Getting Started
         </Typography>

		  <Typography component="subtitle1" color="inherit">
            EASIX offers a lightweight solution for constucting and exporting STIX 2.1 visualisations, for use with exchanging cyber threat intelligence (CTI). EASIX is an open source tool and those interested
			can contribute and ask questions freely
         </Typography>

    </div>

  );
}
